import React from 'react';
import { Link } from 'react-router-dom';
import './MainPage.css';

// Importing images directly for the slideshow
import image1 from './image1.png';
import image2 from './image2.png';
import image3 from './image3.png';

const MainPage = () => {
  return (
    <div className="main-page">
      {/* Dashboards at the top with location and logo */}
      <header className="dashboard-header">
        <div className="logo">Hospital Dashboard</div>
        <div className="location">Location: City Hospital</div>
        <div className="date">Date: 06-Nov-2024</div>
      </header>

      {/* Slideshow section */}
      <div className="slideshow-container">
        <div className="slide">
          <img src={img1} alt="Slide 1" />
        </div>
        <div className="slide">
          <img src={img2} alt="Slide 2" />
        </div>
        <div className="slide">
          <img src={img3} alt="Slide 3" />
        </div>
      </div>

      {/* Navigation buttons for roles (Nurse, Junior Doctor, Senior Doctor) */}
      <div className="role-buttons">
        <Link to="/nurse" className="role-button">Nurse</Link>
        <Link to="/junior-doctor" className="role-button">Junior Doctor</Link>
        <Link to="/senior-doctor" className="role-button">Senior Doctor</Link>
      </div>
    </div>
  );
};

export default MainPage;
